import React from 'react';

const App = () => {
  return (
    <>
      <h1 className="heading_style"> Welcome to <span style = {{ fontWeight : 'bold' }}> Slot Machine Game </span>
      </h1>
      <div className="slotmachine">
        <SlotM x = "smile" y = "smile" z = "smile" />
        <hr />
        <SlotM x = "smile" y = "happiness" z = "smile" />
        <hr />
        <SlotM x = "apple" y = "banana" z = "apple" />
        <hr />
        <SlotM x = "mango" y = "mango" z = "mango" />
      </div>
    </>
  );
};


export default App;
